import React from 'react'

const AttractionViewReview = () => {
    const style={
        background: `url("https://raw.githubusercontent.com/geekypradip/images/main/Screenshot%20from%202022-01-16%2023-36-53.png") no-repeat`,
        width: '100%',
        height: '650px',
    }
    return (
        <div style={style}></div>
    )
}

export default AttractionViewReview
